import React from 'react';
import styles from './HeaderNav.module.scss';
import { Link } from "react-router-dom";

const HeaderNav = () => (
    <nav>
        <ul className={styles.wrapper}>
            <li className={styles.navItem}><Link to="/" className={styles.navItem__Link}>Products</Link></li>
            <li className={styles.navItem}><Link to="/Guide" className={styles.navItem__Link}>Guide</Link></li>
            <li className={styles.navItem}><Link to="/JoinUs" className={styles.navItem__Link}>JoinUs</Link></li>
        </ul>
        
    </nav>
    
);

export default HeaderNav;
